import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <div className=''>
        <NavLink exact activeClassName="active_class" to="/">
          About US
        </NavLink>
        <NavLink exact activeClassName="active_class" to="/contact">
          Contact US
        </NavLink>
      </div>
      <br />
      <a href="/"> AboutUS </a>
      <a href="/contact"> Contact </a>
    </>
  );
};

export default Menu;
